import React from 'react';
import Hero from '../components/Hero';
import Courses from '../components/Courses';
import Header from '../components/Header';

// Add other sections like Testimonials, Instructors later

function Home() {
  return (
    <>
     
      <Header/>
      <Hero />
      <Courses/>

     
    </>
  );
}


export default Home;
